        """
        Checks if a given string is valid according to the given grammar.
        """
        try:
            builder = generate_builder(grammar, string)
            return builder == s
        except:
            return False

    def generate_builder(grammar, string):
        """
        Generates the parser for the given grammar and string.
        """
        try:
            return grammar.parse(string)
        except Exception as e:
            return None

    return is_valid(s, s)

